import React from "react";
import Todo from "./Todos";


const TodoList = ({todos, setTodos}) => {
    return(
        <div className="todo-container">
            <ul className="todo-list"></ul>
            <div>
            {todos.map((todo) => (
                <Todo 
                    key={todo.id}
                    text={todo.text}
                    todos={todos} 
                    todo={todo}
                    setTodos={setTodos} 
                />
            ))}
            </div>

        </div>
    );
};

export default TodoList;
